#include "includes.h"
#include "TalComponent.h"

TalComponent::TalComponent (TalCore* const ownerFilter)
: AudioProcessorEditor (ownerFilter)
{
    Image backgroundImage = ImageCache::getFromMemory(bmp00128_png, bmp00128_pngSize);
	Image knobImage = ImageCache::getFromMemory(bmp00129_png, bmp00129_pngSize);
	Image sliderKnob = ImageCache::getFromMemory(bmp00130_png, bmp00130_pngSize);
	Image offButtonImg = ImageCache::getFromMemory(bmp00132_png, bmp00132_pngSize);
	Image onButtonImg = ImageCache::getFromMemory(bmp00133_png, bmp00133_pngSize);

	decayTimeKnob = addNormalKnob(314 - 8, 68, ownerFilter, knobImage, DECAYTIME);
	preDelayKnob = addNormalKnob(386 - 8, 68, ownerFilter, knobImage, PREDELAY);

	highShelfFrequencyKnob = addNormalKnob(153 - 8, 34, ownerFilter, knobImage, HIGHSHELFFREQUENCY);
	peakFrequencyKnob  = addNormalKnob(153 - 8, 106, ownerFilter, knobImage, PEAKFREQUENCY);
	lowShelfFrequencyKnob = addNormalKnob(154 - 8, 181, ownerFilter, knobImage, LOWSHELFFREQUENCY);

	highShelfGainKnob = addNormalKnob(223 - 8, 34, ownerFilter, knobImage, HIGHSHELFGAIN);
	peakGainKnob = addNormalKnob(223 - 8, 106, ownerFilter, knobImage, PEAKGAIN);
	lowShelfGainKnob = addNormalKnob(224 - 8, 181, ownerFilter, knobImage, LOWSHELFGAIN);

	stereoWithKnob = addNormalKnob(314 - 8, 180, ownerFilter, knobImage, STEREO);

	addAndMakeVisible(drySlider = new ImageSlider(sliderKnob, 127));
	addAndMakeVisible(wetSlider = new ImageSlider(sliderKnob, 127));

    drySlider->setBounds(449, 67, sliderKnob.getWidth(), 179);
    wetSlider->setBounds(519, 67, sliderKnob.getWidth(), 179);

	// Version info
	versionLabel = new Label("Version Info", "V 1.61");
	versionLabel->setBounds(4, 1, 100, 20);
	versionLabel->setColour(Label::textColourId, Colour((juce::uint8)100, (juce::uint8)100, (juce::uint8)100, 0.8f));
	addAndMakeVisible(versionLabel);

	realStereoModeButton = new ImageToggleButton("Toggle Button", offButtonImg, onButtonImg);
	realStereoModeButton->setBounds(373, 170, 71, 52);
	addAndMakeVisible(realStereoModeButton);

        updateParametersFromFilter();

    // set our component's initial size to be the last one that was stored in the filter's settings
    setSize (backgroundImage.getWidth(), backgroundImage.getHeight());

	// Register change listener after initialisation
	drySlider->addListener (this);
	wetSlider->addListener (this);
	realStereoModeButton->addListener (this);

    // register ourselves with the filter - it will use its ChangeBroadcaster base
    // class to tell us when something has changed, and this will call our changeListenerCallback()
    // method.
    ownerFilter->addChangeListener (this);
}

TalComponent::~TalComponent()
{
    // ImageCache::release (internalCachedBackgroundImage);
    getFilter()->removeChangeListener (this);
    deleteAllChildren();
}

FilmStripKnob* TalComponent::addNormalKnob(int x, int y, TalCore* const ownerFilter, Image knobImage, int parameter)
{
	FilmStripKnob *filmStripKnob;
	addAndMakeVisible(filmStripKnob = new FilmStripKnob(knobImage,
									 knobImage.getHeight() / knobImage.getWidth(),
									 false));
    filmStripKnob->setBounds(x, y, knobImage.getWidth() + 16, knobImage.getWidth() + 20);
	filmStripKnob->addListener (this);
	return filmStripKnob;
}

//==============================================================================
void TalComponent::paint (Graphics& g)
{
    // just clear the window
    g.fillAll (Colour::greyLevel (0.9f));

    Image backgroundImage = ImageCache::getFromMemory(bmp00128_png, bmp00128_pngSize);
    g.drawImage (backgroundImage,
                 0, 0, backgroundImage.getWidth(), backgroundImage.getHeight(),
                 0, 0, backgroundImage.getWidth(), backgroundImage.getHeight());
}

//==============================================================================
void TalComponent::changeListenerCallback (ChangeBroadcaster* source)
{
    // this is the filter telling us that it's changed, so we'll update our
    // display of the time, midi message, etc.
    updateParametersFromFilter();
}

void TalComponent::sliderValueChanged (Slider* caller)
{
    TalCore* const filter = getFilter();
	if (caller == decayTimeKnob) filter->setParameterNotifyingHost(DECAYTIME, (float)decayTimeKnob->getValue());
	if (caller == preDelayKnob) filter->setParameterNotifyingHost(PREDELAY, (float)preDelayKnob->getValue());

	if (caller == lowShelfFrequencyKnob) filter->setParameterNotifyingHost(LOWSHELFFREQUENCY, (float)lowShelfFrequencyKnob->getValue());
	if (caller == highShelfFrequencyKnob) filter->setParameterNotifyingHost(HIGHSHELFFREQUENCY, (float)highShelfFrequencyKnob->getValue());
	if (caller == peakFrequencyKnob) filter->setParameterNotifyingHost(PEAKFREQUENCY, (float)peakFrequencyKnob->getValue());

	if (caller == lowShelfGainKnob) filter->setParameterNotifyingHost(LOWSHELFGAIN, (float)lowShelfGainKnob->getValue());
	if (caller == highShelfGainKnob) filter->setParameterNotifyingHost(HIGHSHELFGAIN, (float)highShelfGainKnob->getValue());
	if (caller == peakGainKnob) filter->setParameterNotifyingHost(PEAKGAIN, (float)peakGainKnob->getValue());

	if (caller == stereoWithKnob) filter->setParameterNotifyingHost(STEREO, (float)stereoWithKnob->getValue());
	if (caller == drySlider) filter->setParameterNotifyingHost(DRY, (float)drySlider->getValue());
	if (caller == wetSlider) filter->setParameterNotifyingHost(WET, (float)wetSlider->getValue());
}

void TalComponent::buttonClicked (Button* caller)
{
    TalCore* const filter = getFilter();
	if (caller == realStereoModeButton)
	{
		float realStereoMode = caller->getToggleState() ? 1.0f : 0.0f;
		filter->setParameterNotifyingHost(REALSTEREOMODE, realStereoMode);
	}
}

//==============================================================================
void TalComponent::updateParametersFromFilter()
{
    TalCore* const filter = getFilter();

    // we use this lock to make sure the processBlock() method isn't writing to the
    // lastMidiMessage variable while we're trying to read it, but be extra-careful to
    // only hold the lock for a minimum amount of time..
    filter->getCallbackLock().enter();

    // take a local copy of the info we need while we've got the lock..
	float roomSize = filter->getParameter(DECAYTIME);
	float preDelay = filter->getParameter(PREDELAY);

	float lowShelfFrequency = filter->getParameter(LOWSHELFFREQUENCY);
	float highShelfFrequency = filter->getParameter(HIGHSHELFFREQUENCY);
	float peakFrequency = filter->getParameter(PEAKFREQUENCY);

	float lowShelfGain = filter->getParameter(LOWSHELFGAIN);
	float highShelfGain = filter->getParameter(HIGHSHELFGAIN);
	float peakGain = filter->getParameter(PEAKGAIN);

	float stereo = filter->getParameter(STEREO);

	float dry = filter->getParameter(DRY);
	float wet = filter->getParameter(WET);

	float realStereoMode = filter->getParameter(REALSTEREOMODE);

    // ..release the lock ASAP
    filter->getCallbackLock().exit();

	decayTimeKnob->setValue(roomSize, dontSendNotification);

	preDelayKnob->setValue(preDelay, dontSendNotification);
	preDelayKnob->setTextValue(juce::String((int)(audioUtils.getLogScaledValue(preDelay) * 1000)) + T("ms"));

	lowShelfFrequencyKnob->setValue(lowShelfFrequency, dontSendNotification);
	lowShelfFrequencyKnob->setTextValue(juce::String((int)audioUtils.getLogScaledFrequency(lowShelfFrequency)) + T("Hz"));

	highShelfFrequencyKnob->setValue(highShelfFrequency, dontSendNotification);
	highShelfFrequencyKnob->setTextValue(juce::String((int)audioUtils.getLogScaledFrequency(highShelfFrequency)) + T("Hz"));

	peakFrequencyKnob->setValue(peakFrequency, dontSendNotification);
	peakFrequencyKnob->setTextValue(juce::String((int)audioUtils.getLogScaledFrequency(peakFrequency)) + T("Hz"));

	lowShelfGainKnob->setValue(lowShelfGain, dontSendNotification);
	lowShelfGainKnob->setTextValue(juce::String(audioUtils.getLogScaledValueInDecibelFilter(lowShelfGain, 1), 1) + T("dB"));

	highShelfGainKnob->setValue(highShelfGain, dontSendNotification);
	highShelfGainKnob->setTextValue(juce::String(audioUtils.getLogScaledValueInDecibelFilter(highShelfGain, 1), 1) + T("dB"));

	peakGainKnob->setValue(peakGain, dontSendNotification);
	peakGainKnob->setTextValue(juce::String(audioUtils.getLogScaledValueInDecibelFilter(peakGain, 1), 1) + T("dB"));

	stereoWithKnob->setValue(stereo, dontSendNotification);

	drySlider->setValue(dry, dontSendNotification);
	drySlider->setTextValue(juce::String(audioUtils.getLogScaledValueInDecibel(dry, 2), 1) + T("dB"));

	wetSlider->setValue(wet, dontSendNotification);
	wetSlider->setTextValue(juce::String(audioUtils.getLogScaledValueInDecibel(wet, 2), 1) + T("dB"));

	realStereoModeButton->setToggleState((realStereoMode > 0.0f), dontSendNotification);
}

